import React from "react";
import { Container, Box } from "@mui/system";
import { Button, Grid, Paper, TextField, Typography, Divider, ButtonGroup } from "@mui/material";
import { useNavigate, useLocation } from "react-router-dom";

function RegisterForm(){
    //const { urlBefore } = props;

    const location = useLocation();
    const urlBefore = location.state;
    const afterReg = () => {
        document.location.assign(urlBefore);
    }

    let i = 1;
    const anana = () => {
        console.log(i);
        i+=1;
    }

    return(
        //<Button onClick={afterReg}>ananas</Button>
        <Box>
        <Container fixed>
            <Paper sx={{mt: 2}}>
            <Grid
  container
  spacing={0}
  direction="column"
  alignItems="center"
  justifyContent="center"
  style={{ minHeight: '100vh' }}
>

  <Grid item xs={3}>
                <Box
                component="form"
                sx={{p: 2,
                    '& .MuiTextField-root': { m: 1, width: '45ch' }}}
                noValidate
                autoComplete="off"
                >
                <Typography variant="h4">
                Регистрация
                </Typography>
                <Divider textAlign="left" sx={{mt: 1}}>Заполните поля(отмеченные под * обязательные к заполнению):</Divider>
                <TextField 
                required
                id = "nickname"
                label = "Имя аккаунта"
                helperText="Будет использоваться при входе в систему"
                />
                <TextField 
                required
                id = "number"
                label = "Номер телефона"
                helperText="По номеру телефона пользователи смогут связаться с вами"
                />
                <ButtonGroup>
                    <Button>Физическое лицо(пришли за покупками)</Button>
                    <Button>Юридическое лицо(нужны продажи)</Button>
                </ButtonGroup>
                <TextField 
                required
                id = "name"
                label = "Имя"
                helperText="Другие пользователи будут знать, как к вам обращаться"/>
                <TextField 
                id = "surname"
                label = "Фамилия(или отчество)"/>

                </Box>
                </Grid>   

   </Grid> 
            </Paper>
        </Container>
        </Box>
    )
}

export default RegisterForm;
